(4, 2, 0, 0, 'Which of the following is NOT supplied by the anterior division of the mandibular nerve?', 'insert diagram', 0, 0, 'Temporalis', 'Medial Pterygoid', 'Lateral Pterygoid', 'Masseter', '2', 0, 1, 0, 0, 1, '2021-12-16 15:30:14', '0000-00-00 00:00:00'),
(5, 2, 0, 0, 'The most stable anatomic landmark for bifurcation of the common carotid artery is', 'insert diagram', 0, 0, 'Hyoid bone', 'Upper border of thyroid cartilage', 'Upper border of cricoid cartilage', 'Cricothyroid membrane', '2', 0, 1, 0, 0, 1, '2021-12-16 15:30:14', '0000-00-00 00:00:00'),
(6, 4, 0, 0, '38 year old woman, known to have polycythemia vera on treatment, presents with complaints of severe and constant right upper quadrant pain over the past two days. Physical examination reveals an enlar', 'The stem has 3 parts: a pre existing disease, a clinical symptom and 2 physical examination clues.\nThe stem asks for a complication of polycythemia vera. Right upper quadrant pain can be due to hepatitis, cholecystitis, acute pancreatitis.\nThe clinical clue is a tender liver - hepatitis or congested liver. The presence of dilated abdominal vein in the presence of a tender liver has only one diagnosis - outflow obstruction to the liver = Budd Chiari syndrome.\nBudd chiari is not associated with pi', 0, 0, 'Ascites', 'Spider nevi', 'Esophageal varices', 'Pigmented skin', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(7, 4, 0, 0, '38 year old woman who is a known case of polycythemia vera, diabetes mellitus and elevated creatinine presents with complaints of severe and constant right upper quadrant pain over the past two days. ', 'The anti–factor Xa assay is designed to measure plasma heparin (unfractionated heparin [UH] and low molecular weight heparin [LMWH]) levels and to monitor anticoagulant therapy.', 0, 0, 'Anti Xa levels', 'Platelet count', 'aPTT', 'INR', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(8, 4, 0, 0, '54 year old gentleman was noted to have glycosuria (glucose in urine) by his general practitioner. Your consultant confirms the diagnosis of type 2 diabetes and initiates treatment. Why does the patie', 'The kidney contributes to glucose homeostasis through processes of gluconeogenesis, glucose filtration, glucose reabsorption, and glucose consumption. The PCT avidly reabsorbs filtered glucose into the peritubular capillaries so that it is all reabsorbed by the end of the proximal tubule. Increased Solute Loads in the Distal Nephron leads to an Osmotic Diuresis. \nGlucose is a small molecule and is easily filtered (only 9 Angstrom in diameter). It is filtered in normal individuals. All glucose re', 0, 0, 'Defective glomerular filtration', 'Active Proximal tubular secretion of glucose', 'Saturated PCT reabsorption of glucose', 'Defective absorption in distal convoluted tubule', '3', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(9, 4, 0, 0, '58-year-old man with nephrotic syndrome is brought to the emergency department with mental status changes. His wife reports that this morning he had difficulty moving the right side of his body, and t', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basi', 0, 0, 'Increased Protein C', 'Increased Protein S', 'Increased Fibrinogen', 'increased Antithrombin III', '3', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(10, 4, 0, 0, '38-year-old man with nephrotic syndrome is brought to the emergency department with sudden onset of hematuria. He reports that this morning he had blood stained urination, and he did not pass any clot', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basi', 0, 0, 'Decreased Protein C', 'Decreased Protein S', 'Decreased Fibrinogen', 'Decreased Antithrombin III', '3', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(11, 4, 0, 0, '65 year old gentleman was found unconscious in his house by his neighbor and was brought to the hospital. On admission to the emergency department, his laboratory tests show: Sodium: 137 mEq/L , Potas', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the o', 0, 0, 'Diabetic ketoacidosis', 'Severe diarrhea', 'Lactic acidosis', 'Uremia', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(12, 4, 0, 0, 'Physiological anemia of pregnancy is due to:', 'Please refer to list of physiologic changes in pregnancy for a more complete review', 0, 0, 'Decrease in plasma iron binding capacity', 'Bone marrow hypoactivity', 'Disproportionate increase in plasma volume', 'Vitamin B12 deficiency', '3', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(13, 4, 0, 0, 'Which of the following isotopes is commonly used in teletherapy?', 'Radiotherapy for cancer has 2 major divisions: Brachytherapy and teletherapy. The substance used must be able to provide the radiation dose that can travel the distance.', 0, 0, 'Pd-103', 'Tc- 99', 'Co-60', 'Ir -19', '3', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(14, 4, 0, 0, '68 year old man with poorly controlled diabetes, presents with breathlessness on exertion, Chest tightness on exertion, bilateral pulmonary rales and pitting pedal edema. His investigations show eleva', 'The clinical symptom that is presented in angina, in a diabetic. Classical chest pain is not common in diabetic individuals.\nAn elevated BNP is suggestive of volume expansion and increased wall stress on cardiac myocytes. A value higher than 100 pg/ml is considered abnormal. Higher the number, the more likely heart failure is present.\nHeart failure cannot happen in pericardial effusion or left atrial mural thrombosis.\nThere is no past history of any caondition that can cause mitral valve thicken', 0, 0, 'Critical coronary stenosis', 'Left atrial mural thrombosis', 'Mitral valve thickening', 'Pericardial effusion', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(15, 4, 0, 0, 'Which of the following confirmed values meet the diagnostic threshold for diabetes?', 'As per the American Diabetic Association, there are 3 precise ways of diagnosing diabetes. The 3 tests are HbA1c, Fasting blood sugar and oral glucose tolerance test. A HbA1c > 6.5, a fasting blood sugar > 126 mg/dl and 2 hour post prandial blood sugar during OGTT > 200 mg/dl are all diagnostic of diabetes mellitus. An RBS of > 200 mg/dl is also diagnostic of diabetes.', 0, 0, 'Fasting blood glucose > 126 mg/dl', 'Fasting blood glucose > 100 mg/dl', '2 hours post prandial glucose > 126 mg/dl', 'Randome blood sugar > 160 mg/dl', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(16, 4, 0, 0, 'The pathogenesis of hyperglycemia in diabetic ketoacidosis includes all the following mechanisms except for:', 'DKA happens in a state of absolute or relative insulin deficiency. There is accelerated gluconeogenesis, glycogenolysis, and decreased glucose utilization. Gluconeogenesis happens in liver and kidneys only. Glycogenolysis occurs primarily in the liver and is stimulated by the hormones glucagon and epinephrine. DKA is associated with increased serum glucagon.\nGluconeogenesis cannot occur in the adipose tissue. (It happens only in liver and kidney)', 0, 0, 'Increased glycogenolysis in the liver', 'Increased gluconeogenesis in the kidneys', 'Increased serum glucagon', 'Increased gluconeogenesis in adipose tissue', '4', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(17, 4, 0, 0, 'Insulin deficiency is associated with', 'Insulin deficiency is associated with increased proteolysis, increased lipolysis, increased gluconeogenesis and increased ketogenesis.', 0, 0, 'Reduced lipolysis', 'Increased ketogenesis', 'Reduced gluconeogenesis', 'Reduced proteolysis', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(18, 4, 0, 0, 'The pathogenesis of hyperglycemia in type 2 diabetes includes all the following mechanisms except for', 'See sticker diagram.\nDecreased insulin and increased glucagon is associated with increased glycogenolysis and gluconeogenesis.\nInsulin also reduces the glucose uptake by peripheral tissues.', 0, 0, 'Increased glucose production by the liver', 'Impaired insulin secretion', 'Decreased glucose uptake by skeletal muscle', 'All of the above', '4', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(19, 4, 0, 0, '48 year old diabetic patient has come for his review . He is currently on dual drug regimen for the control of diabetes. Which of the following tests will you order to check mean plasma glucose concen', 'Glycated hemoglobin (A1C, hemoglobin A1C, HbA1c), which reflects average levels of blood glucose over the previous two to three months, is the most widely used test to monitor chronic glycemic control. It is used to diagnose diabetes and to monitor the efficacy of treatment. Other blood tests (eg, fructosamine, glycated albumin) that reflect average glucose levels over the preceding two to three weeks are sometimes used.', 0, 0, 'HbA1c', 'OGTT', 'Fructosamine test', 'Fasting plasma glucose', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(20, 4, 0, 0, '38 year old diabetic patient is advised exercise on a regular basis. Which of the following is not a beneficial effect of exercise in people with diabetes:', 'Hypoglycemia is an adverse event associated with exercise in diabetic patients.', 0, 0, 'Reduction of triglycerides', 'Hypoglycemia', 'Increase in insulin sensitivity', 'Control of hypertension', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(21, 4, 0, 0, '48 year old male patient was diagnosed with type 2 diabetes recently. His BMI is 33.4. We are initiating treatment in this patient. What is the first-line drug for this patients with type 2 diabetes?', 'The first line of treatment in a patient with Type 2 Diabetes mellitus is METFORMIN (Biguanide). This is associated with weight loss, minimal hypoglycemia risk. There are no contraindications. It is very cheap.', 0, 0, 'Acarbose', 'Metformin', 'Sulphonylurea', 'Insulin', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
