(25, 4, 0, 0, 'Beck\'s triad is seen in', 'The three signs are: low blood pressure (weak pulse or narrow pulse pressure) muffled heart sounds. raised jugular venous pressure. It is the classical triad of cardiac tamponade.', 0, 0, 'Constrictive pericarditis', 'Cardiac tamponade', 'Right ventricular myocardial infarction', 'Restrictive cardiomyopathy', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(26, 4, 0, 0, '48 year old lady with a BMI of 32 presented with right upper quadrant abdominal pain. The pain is constant, lasts 15 - 30 minutes and associated with nausea. Pain happens after a meal and at night. Th', 'The classical description of Fat, fertile, female of forty is given here. The description is for a diagnosis of gall stone.Right upper quadrant pain, constant, post prandial and occuring at night is typical of biliary colic. The diagnostic test of choice is ultrasoun of the abdomen.', 0, 0, 'CBC', 'Ultrasound of the abdomen', 'Plain X ray of the abdomen', 'CT scan of the abdomen', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(27, 4, 0, 0, 'A patient presents with following parameters in his ABG: pH 7.25, PCO2 30 mm Hg, PO2 98 mm Hg and HCO3 16.\nWhat is the acid base imbalance noted?', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the o', 0, 0, 'Respiratory alkalosis', 'Respiratory acidosis', 'Metabolic alkalosis', 'Metabolic acidosis', '4', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(28, 4, 0, 0, '18 year old girl presents with fatigue, lethargy and weakness. CBC show Hb of 7.0 g/dl, MCV 70 and MCH 20 and RDW of 24. The most likely diagnosis is:', 'The differential diagnosis of microcytic anemia is remembered easily by the mnemonic TICS: Thalassemia, Iron deficiency anemia, Anemia of chronic disease and Sideroblastic anemia. A microcytic anemia with an RDW > 21 is very much suggestive of IDA. Sickle cell disease does not manifest with iron deficiency anemia.', 0, 0, 'Iron deficiency anemia', 'Thalassemia major', 'Thalassemia minor', 'Sickle cell trait', '1', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(29, 4, 0, 0, 'RIFLE grading is used in', 'RIFLE criteria is used to assess acute kidney injury as per the ADQI 2004 guidelines. It stands for risk, injury, failure, loss and end stage kidney disease.', 0, 0, 'Chronic kidney disease', 'Acute kidney injury', 'Gunshot injury', 'Renal cell carcinoma', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(30, 4, 0, 0, 'TIPS is associated with the following complication:', 'Potential complications of TIPS include acute liver failure, hepatic encephalopathy, hemorrhage, biliary injury, injury to surrounding organs, TIPS thrombosis, TIPS dysfunction, and TIPS migration.', 0, 0, 'Spenic ruture', 'Hepatic encephalopathy', 'SBP', 'HRS', '2', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
(31, 4, 0, 0, 'The first line treatment for refractory ascites is:', 'The available therapies are repeated large volume paracentesis (LVP), transjugular intrahepatic portosystemic shunts, peritoneovenous shunts, investigational medical therapies, and liver transplantation. LVP with concomitant volume expanders is the initial treatment of choice.', 0, 0, 'Liver transplantation', 'Peritoneovenous shunt', 'TIPS', 'Large volume paracentesis', '4', 0, 1, 0, 0, 1, '2021-12-17 11:06:09', '0000-00-00 00:00:00'),
