(40, 0, 0, 15, '38 year old woman, known to have polycythemia vera on treatment, presents with complaints of severe and constant right upper quadrant pain over the past two days. Physical examination reveals an enlarged tender liver. There are dilated veins in the anterior abdominal wall. What other clinical finding would most likely be seen at presentation?', 'The stem has 3 parts: a pre existing disease, a clinical symptom and 2 physical examination clues.\nThe stem asks for a complication of polycythemia vera. Right upper quadrant pain can be due to hepatitis, cholecystitis, acute pancreatitis.\nThe clinical clue is a tender liver - hepatitis or congested liver. The presence of dilated abdominal vein in the presence of a tender liver has only one diagnosis - outflow obstruction to the liver = Budd Chiari syndrome.\nBudd chiari is not associated with pigmented skin. Pigmented skin is seen in hemochomatosis (Bronzed skin)\nEsophageal varices is not a clinical sign. It is detected in investigation.\nSpider naevi is associated with chronic liver disease. This is an acute issue.\nThe correct option is option 1 - Ascites.', 0, 0, 'Ascites', 'Spider nevi', 'Esophageal varices', 'Pigmented skin', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(41, 0, 0, 15, '38 year old woman who is a known case of polycythemia vera, diabetes mellitus and elevated creatinine presents with complaints of severe and constant right upper quadrant pain over the past two days. Physical examination reveals a tender, enlarged liver and moderate ascites. CT confirms the diagnosis of Budd Chiari syndrome. Anticoagulation is started with low molecular weight heparin. How should we monitor the anticoagulation in this patient in this phase of illness?', 'The anti–factor Xa assay is designed to measure plasma heparin (unfractionated heparin [UH] and low molecular weight heparin [LMWH]) levels and to monitor anticoagulant therapy.', 0, 0, 'Anti Xa levels', 'Platelet count', 'aPTT', 'INR', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(42, 0, 0, 15, '54 year old gentleman was noted to have glycosuria (glucose in urine) by his general practitioner. Your consultant confirms the diagnosis of type 2 diabetes and initiates treatment. Why does the patient have glycosuria?', 'The kidney contributes to glucose homeostasis through processes of gluconeogenesis, glucose filtration, glucose reabsorption, and glucose consumption. The PCT avidly reabsorbs filtered glucose into the peritubular capillaries so that it is all reabsorbed by the end of the proximal tubule. Increased Solute Loads in the Distal Nephron leads to an Osmotic Diuresis. \nGlucose is a small molecule and is easily filtered (only 9 Angstrom in diameter). It is filtered in normal individuals. All glucose related events happen in the proximal tubule of the kidney. \nFiltered glucose is absorbed through the SGLT 1 and SGLT 2 co transporters.\n', 0, 0, 'Defective glomerular filtration', 'Active Proximal tubular secretion of glucose', 'Saturated PCT reabsorption of glucose', 'Defective absorption in distal convoluted tubule', '3', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(43, 0, 0, 15, '58-year-old man with nephrotic syndrome is brought to the emergency department with mental status changes. His wife reports that this morning he had difficulty moving the right side of his body, and that she couldn’t wake him up from an afternoon nap. On physical examination the patient has a GCS of 10/15 and has absent right-sided movement. His International Normalized Ratio (INR) is = 0.5. CT shows features of thrombotic stroke. What is the underlying disturbance in his coagulation system that caused the stroke?', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basic mechanisms: (1) urinary losses of antithrombotic proteins and (2) increased synthesis of prothrombotic factors. \n\nDecreased antithrombotic factors include the following: Antithrombin III, Proteins C and S (conflicting data)\nIncreased synthesis of prothrombotic factors include the following: Increased platelet number, activation, and aggregation, \nElevation in levels of factors V and VIII, von Willebrand factor, ?2-plasmin inhibitor, plasminogen activator inhibitor 1, and fibrinogen\nIncreased activities of tissue plasminogen activator and plasminogen activator inhibitor-1\n\nThese abnormalities in hemostatic factors, combined with potential hypovolemia, immobility, and increased incidence of infection, lead to a hypercoagulable state in INS.', 0, 0, 'Increased Protein C', 'Increased Protein S', 'Increased Fibrinogen', 'increased Antithrombin III', '3', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(44, 0, 0, 15, '38-year-old man with nephrotic syndrome is brought to the emergency department with sudden onset of hematuria. He reports that this morning he had blood stained urination, and he did not pass any clots. He had left flank pain. On physical examination the patient has mild tenderness in the left renal angle. His International Normalized Ratio (INR) is = 0.6. CT shows features of left renal vein thrombosis. All the following can cause coagulation abnormalities leading to thrombosis, except?', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basic mechanisms: (1) urinary losses of antithrombotic proteins and (2) increased synthesis of prothrombotic factors. \n\nDecreased antithrombotic factors: Antithrombin III, Proteins C and S (conflicting data)\nIncreased synthesis of prothrombotic factors : Increased platelet number, activation, and aggregation, \nElevation in levels of factors V and VIII, von Willebrand factor, ?2-plasmin inhibitor, plasminogen activator inhibitor 1, and fibrinogen\nIncreased activities of tissue plasminogen activator and plasminogen activator inhibitor-1\n\nThese abnormalities in hemostatic factors, combined with potential hypovolemia, immobility, and increased incidence of infection, lead to a hypercoagulable state in INS.', 0, 0, 'Decreased Protein C', 'Decreased Protein S', 'Decreased Fibrinogen', 'Decreased Antithrombin III', '3', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(45, 0, 0, 15, '65 year old gentleman was found unconscious in his house by his neighbor and was brought to the hospital. On admission to the emergency department, his laboratory tests show: Sodium: 137 mEq/L , Potassium: 3.2 mEq/L, Chloride: 112 mEq/L ,Bicarbonate: 18 mEq/L . ABG on room air: pH 7.28, PCO2: 28 mm Hg, PO2: 90 mm Hg. Which of the following most likely caused his condition?', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the option that is associated with normal anion gap metabolic acidosis is diarrhea.', 0, 0, 'Diabetic ketoacidosis', 'Severe diarrhea', 'Lactic acidosis', 'Uremia', '2', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(46, 0, 0, 15, 'Physiological anemia of pregnancy is due to:', 'Please refer to list of physiologic changes in pregnancy for a more complete review', 0, 0, 'Decrease in plasma iron binding capacity', 'Bone marrow hypoactivity', 'Disproportionate increase in plasma volume', 'Vitamin B12 deficiency', '3', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
