(60, 0, 0, 15, '48 year old lady with a BMI of 32 presented with right upper quadrant abdominal pain. The pain is constant, lasts 15 - 30 minutes and associated with nausea. Pain happens after a meal and at night. There is no fever or jaundice. What is the best investigation to confirm the diagnosis?', 'The classical description of Fat, fertile, female of forty is given here. The description is for a diagnosis of gall stone.Right upper quadrant pain, constant, post prandial and occuring at night is typical of biliary colic. The diagnostic test of choice is ultrasoun of the abdomen.', 0, 0, 'CBC', 'Ultrasound of the abdomen', 'Plain X ray of the abdomen', 'CT scan of the abdomen', '2', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(61, 0, 0, 15, 'A patient presents with following parameters in his ABG: pH 7.25, PCO2 30 mm Hg, PO2 98 mm Hg and HCO3 16.\nWhat is the acid base imbalance noted?', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the option that is associated with normal anion gap metabolic acidosis is diarrhea.', 0, 0, 'Respiratory alkalosis', 'Respiratory acidosis', 'Metabolic alkalosis', 'Metabolic acidosis', '4', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(62, 0, 0, 15, '18 year old girl presents with fatigue, lethargy and weakness. CBC show Hb of 7.0 g/dl, MCV 70 and MCH 20 and RDW of 24. The most likely diagnosis is:', 'The differential diagnosis of microcytic anemia is remembered easily by the mnemonic TICS: Thalassemia, Iron deficiency anemia, Anemia of chronic disease and Sideroblastic anemia. A microcytic anemia with an RDW > 21 is very much suggestive of IDA. Sickle cell disease does not manifest with iron deficiency anemia.', 0, 0, 'Iron deficiency anemia', 'Thalassemia major', 'Thalassemia minor', 'Sickle cell trait', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(63, 0, 0, 15, 'RIFLE grading is used in', 'RIFLE criteria is used to assess acute kidney injury as per the ADQI 2004 guidelines. It stands for risk, injury, failure, loss and end stage kidney disease.', 0, 0, 'Chronic kidney disease', 'Acute kidney injury', 'Gunshot injury', 'Renal cell carcinoma', '2', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(64, 0, 0, 15, 'TIPS is associated with the following complication:', 'Potential complications of TIPS include acute liver failure, hepatic encephalopathy, hemorrhage, biliary injury, injury to surrounding organs, TIPS thrombosis, TIPS dysfunction, and TIPS migration.', 0, 0, 'Spenic ruture', 'Hepatic encephalopathy', 'SBP', 'HRS', '2', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(65, 0, 0, 15, 'The first line treatment for refractory ascites is:', 'The available therapies are repeated large volume paracentesis (LVP), transjugular intrahepatic portosystemic shunts, peritoneovenous shunts, investigational medical therapies, and liver transplantation. LVP with concomitant volume expanders is the initial treatment of choice.', 0, 0, 'Liver transplantation', 'Peritoneovenous shunt', 'TIPS', 'Large volume paracentesis', '4', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(66, 0, 0, 15, 'A SAAG of > 1.1 g/dl is indicative of:', 'A high gradient (SAAG >1.1 g/dL) indicates portal hypertension and suggests a nonperitoneal cause of ascites.', 0, 0, 'portal hypertension', 'poor liver synthetic function', 'Protein loss in urine', 'Increased portal blood flow', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(67, 0, 0, 15, 'The first line treatment for refractory ascites is:', 'The available therapies are repeated large volume paracentesis (LVP), transjugular intrahepatic portosystemic shunts, peritoneovenous shunts, investigational medical therapies, and liver transplantation. LVP with concomitant volume expanders is the initial treatment of choice.', 0, 0, 'Liver transplantation', 'Peritoneovenous shunt', 'TIPS', 'Large volume paracentesis', '4', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(68, 0, 0, 15, 'A SAAG of > 1.1 g/dl is indicative of:', 'A high gradient (SAAG >1.1 g/dL) indicates portal hypertension and suggests a nonperitoneal cause of ascites.', 0, 0, 'portal hypertension', 'poor liver synthetic function', 'Protein loss in urine', 'Increased portal blood flow', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00'),
(69, 0, 0, 15, 'A SAAG of > 1.1 g/dl is indicative of:', 'A high gradient (SAAG >1.1 g/dL) indicates portal hypertension and suggests a nonperitoneal cause of ascites.', 0, 0, 'portal hypertension', 'poor liver synthetic function', 'Protein loss in urine', 'Increased portal blood flow', '1', 0, 1, 0, 0, 1, '2021-12-20 13:29:27', '0000-00-00 00:00:00');
