(543, 30, 0, 0, '38 year old woman, known to have polycythemia vera on treatment, presents with complaints of severe and constant right upper quadrant pain over the past two days. Physical examination reveals an enlarged tender liver. There are dilated veins in the anterior abdominal wall. What other clinical finding would most likely be seen at presentation?', 'The stem has 3 parts: a pre existing disease, a clinical symptom and 2 physical examination clues.\nThe stem asks for a complication of polycythemia vera. Right upper quadrant pain can be due to hepatitis, cholecystitis, acute pancreatitis.\nThe clinical clue is a tender liver - hepatitis or congested liver. The presence of dilated abdominal vein in the presence of a tender liver has only one diagnosis - outflow obstruction to the liver = Budd Chiari syndrome.\nBudd chiari is not associated with pigmented skin. Pigmented skin is seen in hemochomatosis (Bronzed skin)\nEsophageal varices is not a clinical sign. It is detected in investigation.\nSpider naevi is associated with chronic liver disease. This is an acute issue.\nThe correct option is option 1 - Ascites.', 0, 0, 'Ascites', 'Spider nevi', 'Esophageal varices', 'Pigmented skin', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(544, 30, 0, 0, '38 year old woman who is a known case of polycythemia vera, diabetes mellitus and elevated creatinine presents with complaints of severe and constant right upper quadrant pain over the past two days. Physical examination reveals a tender, enlarged liver and moderate ascites. CT confirms the diagnosis of Budd Chiari syndrome. Anticoagulation is started with low molecular weight heparin. How should we monitor the anticoagulation in this patient in this phase of illness?', 'The anti–factor Xa assay is designed to measure plasma heparin (unfractionated heparin [UH] and low molecular weight heparin [LMWH]) levels and to monitor anticoagulant therapy.', 0, 0, 'Anti Xa levels', 'Platelet count', 'aPTT', 'INR', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(545, 30, 0, 0, '54 year old gentleman was noted to have glycosuria (glucose in urine) by his general practitioner. Your consultant confirms the diagnosis of type 2 diabetes and initiates treatment. Why does the patient have glycosuria?', 'The kidney contributes to glucose homeostasis through processes of gluconeogenesis, glucose filtration, glucose reabsorption, and glucose consumption. The PCT avidly reabsorbs filtered glucose into the peritubular capillaries so that it is all reabsorbed by the end of the proximal tubule. Increased Solute Loads in the Distal Nephron leads to an Osmotic Diuresis. \nGlucose is a small molecule and is easily filtered (only 9 Angstrom in diameter). It is filtered in normal individuals. All glucose related events happen in the proximal tubule of the kidney. \nFiltered glucose is absorbed through the SGLT 1 and SGLT 2 co transporters.\n', 0, 0, 'Defective glomerular filtration', 'Active Proximal tubular secretion of glucose', 'Saturated PCT reabsorption of glucose', 'Defective absorption in distal convoluted tubule', '3', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(546, 30, 0, 0, '58-year-old man with nephrotic syndrome is brought to the emergency department with mental status changes. His wife reports that this morning he had difficulty moving the right side of his body, and that she couldn’t wake him up from an afternoon nap. On physical examination the patient has a GCS of 10/15 and has absent right-sided movement. His International Normalized Ratio (INR) is = 0.5. CT shows features of thrombotic stroke. What is the underlying disturbance in his coagulation system that caused the stroke?', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basic mechanisms: (1) urinary losses of antithrombotic proteins and (2) increased synthesis of prothrombotic factors. \n\nDecreased antithrombotic factors include the following: Antithrombin III, Proteins C and S (conflicting data)\nIncreased synthesis of prothrombotic factors include the following: Increased platelet number, activation, and aggregation, \nElevation in levels of factors V and VIII, von Willebrand factor, ?2-plasmin inhibitor, plasminogen activator inhibitor 1, and fibrinogen\nIncreased activities of tissue plasminogen activator and plasminogen activator inhibitor-1\n\nThese abnormalities in hemostatic factors, combined with potential hypovolemia, immobility, and increased incidence of infection, lead to a hypercoagulable state in INS.', 0, 0, 'Increased Protein C', 'Increased Protein S', 'Increased Fibrinogen', 'increased Antithrombin III', '3', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(547, 30, 0, 0, '38-year-old man with nephrotic syndrome is brought to the emergency department with sudden onset of hematuria. He reports that this morning he had blood stained urination, and he did not pass any clots. He had left flank pain. On physical examination the patient has mild tenderness in the left renal angle. His International Normalized Ratio (INR) is = 0.6. CT shows features of left renal vein thrombosis. All the following can cause coagulation abnormalities leading to thrombosis, except?', 'Nephrotic syndrome (NS) is associated with several disorders of hemostasis: thrombocytosis and platelet hyperaggregability; increased plasma levels of factors V and VIII, and of fibrinogen with blood hyperviscosity; decreased plasma levels of natural anticoagulants: free protein S, and antithrombin III compensated by increased levels of alpha 2-macroglobulin; lowered fibrinolytic activity.\nNephrotic syndrome is a hypercoagulable state. The increased risk of thrombosis can be attributed to 2 basic mechanisms: (1) urinary losses of antithrombotic proteins and (2) increased synthesis of prothrombotic factors. \n\nDecreased antithrombotic factors: Antithrombin III, Proteins C and S (conflicting data)\nIncreased synthesis of prothrombotic factors : Increased platelet number, activation, and aggregation, \nElevation in levels of factors V and VIII, von Willebrand factor, ?2-plasmin inhibitor, plasminogen activator inhibitor 1, and fibrinogen\nIncreased activities of tissue plasminogen activator and plasminogen activator inhibitor-1\n\nThese abnormalities in hemostatic factors, combined with potential hypovolemia, immobility, and increased incidence of infection, lead to a hypercoagulable state in INS.', 0, 0, 'Decreased Protein C', 'Decreased Protein S', 'Decreased Fibrinogen', 'Decreased Antithrombin III', '3', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(548, 30, 0, 0, '65 year old gentleman was found unconscious in his house by his neighbor and was brought to the hospital. On admission to the emergency department, his laboratory tests show: Sodium: 137 mEq/L , Potassium: 3.2 mEq/L, Chloride: 112 mEq/L ,Bicarbonate: 18 mEq/L . ABG on room air: pH 7.28, PCO2: 28 mm Hg, PO2: 90 mm Hg. Which of the following most likely caused his condition?', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the option that is associated with normal anion gap metabolic acidosis is diarrhea.', 0, 0, 'Diabetic ketoacidosis', 'Severe diarrhea', 'Lactic acidosis', 'Uremia', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(549, 30, 0, 0, 'Physiological anemia of pregnancy is due to:', 'Please refer to list of physiologic changes in pregnancy for a more complete review', 0, 0, 'Decrease in plasma iron binding capacity', 'Bone marrow hypoactivity', 'Disproportionate increase in plasma volume', 'Vitamin B12 deficiency', '3', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(550, 30, 0, 0, 'Which of the following isotopes is commonly used in teletherapy?', 'Radiotherapy for cancer has 2 major divisions: Brachytherapy and teletherapy. The substance used must be able to provide the radiation dose that can travel the distance.', 0, 0, 'Pd-103', 'Tc- 99', 'Co-60', 'Ir -19', '3', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(551, 30, 0, 0, '68 year old man with poorly controlled diabetes, presents with breathlessness on exertion, Chest tightness on exertion, bilateral pulmonary rales and pitting pedal edema. His investigations show elevated Brain Natriuretic peptide (BNP). Chest X ray shows prominent right and left heart borders. Which one of the following is the most likely cause of his symptoms?', 'The clinical symptom that is presented in angina, in a diabetic. Classical chest pain is not common in diabetic individuals.\nAn elevated BNP is suggestive of volume expansion and increased wall stress on cardiac myocytes. A value higher than 100 pg/ml is considered abnormal. Higher the number, the more likely heart failure is present.\nHeart failure cannot happen in pericardial effusion or left atrial mural thrombosis.\nThere is no past history of any caondition that can cause mitral valve thickening and no association exists between mitral valve thickening and diabetes.\nOn the other hand, coronary artery disease is increased in diabetics.', 0, 0, 'Critical coronary stenosis', 'Left atrial mural thrombosis', 'Mitral valve thickening', 'Pericardial effusion', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(552, 30, 0, 0, 'Which of the following confirmed values meet the diagnostic threshold for diabetes?', 'As per the American Diabetic Association, there are 3 precise ways of diagnosing diabetes. The 3 tests are HbA1c, Fasting blood sugar and oral glucose tolerance test. A HbA1c > 6.5, a fasting blood sugar > 126 mg/dl and 2 hour post prandial blood sugar during OGTT > 200 mg/dl are all diagnostic of diabetes mellitus. An RBS of > 200 mg/dl is also diagnostic of diabetes.', 0, 0, 'Fasting blood glucose > 126 mg/dl', 'Fasting blood glucose > 100 mg/dl', '2 hours post prandial glucose > 126 mg/dl', 'Randome blood sugar > 160 mg/dl', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(553, 30, 0, 0, 'The pathogenesis of hyperglycemia in diabetic ketoacidosis includes all the following mechanisms except for:', 'DKA happens in a state of absolute or relative insulin deficiency. There is accelerated gluconeogenesis, glycogenolysis, and decreased glucose utilization. Gluconeogenesis happens in liver and kidneys only. Glycogenolysis occurs primarily in the liver and is stimulated by the hormones glucagon and epinephrine. DKA is associated with increased serum glucagon.\nGluconeogenesis cannot occur in the adipose tissue. (It happens only in liver and kidney)', 0, 0, 'Increased glycogenolysis in the liver', 'Increased gluconeogenesis in the kidneys', 'Increased serum glucagon', 'Increased gluconeogenesis in adipose tissue', '4', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(554, 30, 0, 0, 'Insulin deficiency is associated with', 'Insulin deficiency is associated with increased proteolysis, increased lipolysis, increased gluconeogenesis and increased ketogenesis.', 0, 0, 'Reduced lipolysis', 'Increased ketogenesis', 'Reduced gluconeogenesis', 'Reduced proteolysis', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(555, 30, 0, 0, 'The pathogenesis of hyperglycemia in type 2 diabetes includes all the following mechanisms except for', 'See sticker diagram.\nDecreased insulin and increased glucagon is associated with increased glycogenolysis and gluconeogenesis.\nInsulin also reduces the glucose uptake by peripheral tissues.', 0, 0, 'Increased glucose production by the liver', 'Impaired insulin secretion', 'Decreased glucose uptake by skeletal muscle', 'All of the above', '4', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(556, 30, 0, 0, '48 year old diabetic patient has come for his review . He is currently on dual drug regimen for the control of diabetes. Which of the following tests will you order to check mean plasma glucose concentration over the previous 8 weeks?', 'Glycated hemoglobin (A1C, hemoglobin A1C, HbA1c), which reflects average levels of blood glucose over the previous two to three months, is the most widely used test to monitor chronic glycemic control. It is used to diagnose diabetes and to monitor the efficacy of treatment. Other blood tests (eg, fructosamine, glycated albumin) that reflect average glucose levels over the preceding two to three weeks are sometimes used.', 0, 0, 'HbA1c', 'OGTT', 'Fructosamine test', 'Fasting plasma glucose', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(557, 30, 0, 0, '38 year old diabetic patient is advised exercise on a regular basis. Which of the following is not a beneficial effect of exercise in people with diabetes:', 'Hypoglycemia is an adverse event associated with exercise in diabetic patients.', 0, 0, 'Reduction of triglycerides', 'Hypoglycemia', 'Increase in insulin sensitivity', 'Control of hypertension', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(558, 30, 0, 0, '48 year old male patient was diagnosed with type 2 diabetes recently. His BMI is 33.4. We are initiating treatment in this patient. What is the first-line drug for this patients with type 2 diabetes?', 'The first line of treatment in a patient with Type 2 Diabetes mellitus is METFORMIN (Biguanide). This is associated with weight loss, minimal hypoglycemia risk. There are no contraindications. It is very cheap.', 0, 0, 'Acarbose', 'Metformin', 'Sulphonylurea', 'Insulin', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(559, 30, 0, 0, 'Which of the following gastrointestinal hormone stimulates insulin secretion?', 'GIP and GLP-1 are two hormones that are capable of increasing the insulin level. They are called incretin hormones. The increase in insulin levels with oral glucose is called incretin effec', 0, 0, 'GIP', 'CCK', 'Gastrin', 'Secretin', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(560, 30, 0, 0, 'Which of the following element is needed for insulin to exert its maximal effect in glucose uptake?', 'Chromium improves glucose uptake and metabolism through upregulating the mRNA levels of IR, GLUT4, GS, and UCP3 in skeletal muscle cells', 0, 0, 'Vanadium', 'Molybdenum', 'Selenium', 'Chromium', '4', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(561, 30, 0, 0, 'Which of the following biochemical processes is promoted by insulin?', 'Glucosuria, glycogenolysis and gluconeogenesis are all increased during states of insulin deficiency.\nGlycogen synthesis is stimulated by insulin.', 0, 0, 'Glucosuria', 'Glycogenesis', 'Glycogenolysis', 'Gluconeogenesis', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(562, 30, 0, 0, 'Beck\'s triad is seen in', 'The three signs are: low blood pressure (weak pulse or narrow pulse pressure) muffled heart sounds. raised jugular venous pressure. It is the classical triad of cardiac tamponade.', 0, 0, 'Constrictive pericarditis', 'Cardiac tamponade', 'Right ventricular myocardial infarction', 'Restrictive cardiomyopathy', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(563, 30, 0, 0, '48 year old lady with a BMI of 32 presented with right upper quadrant abdominal pain. The pain is constant, lasts 15 - 30 minutes and associated with nausea. Pain happens after a meal and at night. There is no fever or jaundice. What is the best investigation to confirm the diagnosis?', 'The classical description of Fat, fertile, female of forty is given here. The description is for a diagnosis of gall stone.Right upper quadrant pain, constant, post prandial and occuring at night is typical of biliary colic. The diagnostic test of choice is ultrasoun of the abdomen.', 0, 0, 'CBC', 'Ultrasound of the abdomen', 'Plain X ray of the abdomen', 'CT scan of the abdomen', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(564, 30, 0, 0, 'A patient presents with following parameters in his ABG: pH 7.25, PCO2 30 mm Hg, PO2 98 mm Hg and HCO3 16.\nWhat is the acid base imbalance noted?', 'The stem tests the students ability to assess acidotic states. The clinical condition is only serving as a distraction and will not help you select the right answer.\nTo solve acidosis problems, use the three step prinicple.\n1.Check pH\n2. Check for the pCO2 and HCO3 that aligns with the pH.\n3. If metabolic acidosis, calculate the anion gap.\n\nAll this will give you the right answers.\nIn this patient, the anion gap is 10. So this is a normal anion gap metabolic acidosis. The only condition in the option that is associated with normal anion gap metabolic acidosis is diarrhea.', 0, 0, 'Respiratory alkalosis', 'Respiratory acidosis', 'Metabolic alkalosis', 'Metabolic acidosis', '4', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(565, 30, 0, 0, '18 year old girl presents with fatigue, lethargy and weakness. CBC show Hb of 7.0 g/dl, MCV 70 and MCH 20 and RDW of 24. The most likely diagnosis is:', 'The differential diagnosis of microcytic anemia is remembered easily by the mnemonic TICS: Thalassemia, Iron deficiency anemia, Anemia of chronic disease and Sideroblastic anemia. A microcytic anemia with an RDW > 21 is very much suggestive of IDA. Sickle cell disease does not manifest with iron deficiency anemia.', 0, 0, 'Iron deficiency anemia', 'Thalassemia major', 'Thalassemia minor', 'Sickle cell trait', '1', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(566, 30, 0, 0, 'RIFLE grading is used in', 'RIFLE criteria is used to assess acute kidney injury as per the ADQI 2004 guidelines. It stands for risk, injury, failure, loss and end stage kidney disease.', 0, 0, 'Chronic kidney disease', 'Acute kidney injury', 'Gunshot injury', 'Renal cell carcinoma', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(567, 30, 0, 0, 'TIPS is associated with the following complication:', 'Potential complications of TIPS include acute liver failure, hepatic encephalopathy, hemorrhage, biliary injury, injury to surrounding organs, TIPS thrombosis, TIPS dysfunction, and TIPS migration.', 0, 0, 'Spenic ruture', 'Hepatic encephalopathy', 'SBP', 'HRS', '2', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
(568, 30, 0, 0, 'The first line treatment for refractory ascites is:', 'The available therapies are repeated large volume paracentesis (LVP), transjugular intrahepatic portosystemic shunts, peritoneovenous shunts, investigational medical therapies, and liver transplantation. LVP with concomitant volume expanders is the initial treatment of choice.', 0, 0, 'Liver transplantation', 'Peritoneovenous shunt', 'TIPS', 'Large volume paracentesis', '4', 1, 0, 0, 1, '2021-12-23 12:43:35', '0000-00-00 00:00:00'),
